import './App.css';
import Show from './Show.js';
import { useState } from 'react';
import Cart from './Cart.js'

function App() {
  
  const Products = [
      {id:1, pdname: 'Shirt', imageurl: 'data:image/jpeg;base64,', size: 12, Qty: 1, price: 449},
     
      {id:2, pdname: 'Tshirt', imageurl: 'data:image/jpeg;base64,', size: 14, Qty: 2, price: 549},
     
      {id:3, pdname: 'Shirt', imageurl: 'data:image/jpeg;base64,', size: 16, Qty: 8, price: 649},
      
      {id:4, pdname: 'shorts', imageurl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSsw8HDyaODagh-bLZONkS6I1C-QKwiFv1qUQ&s', size: 18, Qty: 4, price: 349},
     
      {id:5, pdname: 'kurti', imageurl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTk0q9RxolPFgfQD94M17JQRbdH6BCxcsTDcg&s', size: 22, Qty: 5, price: 799},
      
      {id:6, pdname: 'kurti', imageurl: 'data:image/jpeg;base64,', size: 24, Qty: 6, price: 799},
  ]

  const [cart,setCart]=useState([])
  const [content,setContent]=useState("")

  function handleChange(event)
  {
    setContent(event.target.value)
  }
  
  function increase(index,product){
    const updateCart=[...cart]
    const newArray=product.filter(i => 
      i.id===updateCart[index].id
    )
    if(updateCart[index].Qty<newArray[0].Qty)
      {
      updateCart[index].Qty+=1
      setCart(updateCart)
      }
  }

  function decrease(index){
   const updateCart=[...cart]
   if (updateCart[index].Qty>0)
    {
      updateCart[index].Qty-=1
      setCart(updateCart)
    }
  }
  return (
    <div>
      <h1>Shop App Welcomes You!</h1>    
      <input placeholder="Search Here" type="search" value={content} onChange={handleChange} ></input>
      <h1>Available Products</h1>
      <Show inp={content} Products={Products} setCart={setCart} cart={cart} />
      <Cart cart={cart} increase={increase} decrease={decrease} product={Products}/>
    </div>
  );
}

export default App;
